import React from "react";
import cover from "../../images/Image_source_2.png";
import DropdownMenu from "../../components/Dropdownmenu.js";

const About = () => {
  return (
    <div>
      <div className="about_cover">
        <img src={cover} alt="about_cover_image" />
      </div>
      <div className="dropdown-menu-container">
        <DropdownMenu title="Fiabilité" />
        <DropdownMenu title="Respect" />
        <DropdownMenu title="Service" />
        <DropdownMenu title="Sécurité" />
      </div>
    </div>
  );
};

export default About;
